A documentary movie about the influence of &quot;ancient astronauts&quot; in mankind's history.

Sidesplitting fun as William Shatner doffs his Captain Kirk uniform for a suede shirt with a big collar and bell bottoms and heads out onto the road with a film crew of six to explore mankind's mysteries. Shatner's enthusiasm for the material is boundless in energy. You will either be swept up in the marvel of it all or laughing yourself silly, in either event its grand entertainment that actually beat crew mate Leonard Nimoy's far more dignified &quot;In Search Of ...&quot; out of the pop culture refuse chute by a year or two.


